const Categories = () => {
  return (
    <section className="container" id="categories">
      <div style={{ marginBottom: "6rem" }}>
        <h2 className="secondary-header">Trending Collection</h2>

        <div className="category-wrapper"></div>
      </div>
    </section>
  );
};

export default Categories;
